import ExpensItem from "./ExpensItems"


const ExpensesList=(props)=>{
    let noExpensesContent=<p>No Expenses to Show </p>

    if (props.item.length>0){
    noExpensesContent=props.item.map((expense)=>(
     <ExpensItem
      key={expense.id}
      title={expense.title}
      amount={expense.amount} 
      date={expense.date}/>)
      )}
}
